import React, { Component } from 'react';
import './App.css';

class App extends Component {

    constructor(props) {
        super(props);
    }

  render() {
    return (
        <div style={{
            width: '100wvw',
            height: '100vh',
            position: 'fixed',
            transform: 'translateX(' + this.props.left + 'px)',
            animationTimingFunction: 'ease-in',
            zIndex: '-20',
            transition: 'transform .8s ease-in-out'
        }}>
            {this.props.children}
        </div>
    );
  }
}

export default App;
